import './App.css';


const App = () => {
    return (
        <div>
            <h1>Greetings</h1>
            <Hello/>
        </div>
    )
};
const Hello = () => {
    return (
        <div>
            <p>Hello world</p>
        </div>
    )
};
export default App;
